import React from 'react';
import { useParams } from 'react-router-dom';
import Profile from './profile';

function UserProfile() {
  const { userid } = useParams();

  return (
    <div>
        <Profile /> 
        <p> userID: {userid}</p>
    </div>
  );
}

export default UserProfile;
